    [18100002] = "住宅属于玩家建筑，住宅可以提供NPC进行居住。",
    [18100003] = "员工",
    [18100004] = "不同大小建筑拥有员工数量不同，玩家需要每天支付给员工工资。员工工资根据各行业盈利计算得出。",
    [18100005] = "租金",
    [18100006] = "玩家可以利用调节住宅的租金吸引NPC前来居住。",
    [18100007] = "人才",
    [18110001] = "介绍",
    [18110002] = "研究所属于玩家建筑，可以进行研究与发明。",
    [18110003] = "员工",
    [18110004] = "不同大小建筑拥有员工数量不同，玩家需要每天支付给员工工资，员工工资高低影响员工满意度，并决定是否开工，玩家可以进行调节工资稳固员工满意度。",
    [18110005] = "科研线",
    [18110006] = "不同大小的建筑拥有科研线数量不同，每一条科研线可以选择一种商品进行研究或发明。",
    [18110007] = "研究",
    [18110008] = "研究所玩家可以进行商品研究，获得不同等级科技图纸，科技图纸可以提升科技等级。研究商品时仓库需要有对应的原料，根据投入原料数量，决定可研究的科技等级。",
    [18110009] = "发明",
    [18110010] = "研究所玩家可以进行原料与商品的发明，发明原料时无需投放原料，发明商品需要需要投放对应的原料。发明难度较高，分为5个阶段，5个阶段全部成功后获得新原料或新商品科技图纸，发明有失败的几率。",
    [18110011] = "仓库",
    [18110012] = "不同大小的建筑拥有仓库容量不同，研究所玩家可以将原料厂购买的原料存入仓库，方便研究与发明。",
    [18110013] = "人才",
    [18110014] = "运输",
    [18110015] = "玩家可以选择目的地仓库后将仓库中货物进行运输。注：运输需要运费，与运输距离相关。",
    [18120001] = "AI系统",
    [18120002] = "介绍",
    [18120003] = "Scry City中AI系统是最为核心的功能，每个NPC都是City中的市民，他们会根据合理的判定方式去购买商品。",
    [18120004] = "NPC是什么",
    [18120005] = "每个NPC都是城市中的市民，他们分为少年，成年与老年。",
    [18120006] = "城市人口生成",
    [18120007] = "玩家在建造建筑的同时会生成成年NPC员工，而每个成年NPC会带着4~8名少年与老年NPC家属。",
    [18120008] = "NPC行为概率",
    [18120009] = "NPC消费选择",
    [18120010] = "NPC如何开工",
    [18120011] = "玩家在建造建筑后需要发给NPC一定的工资，NPC会优先寻找住宅，并开工。若NPC没有住宅，则员工满意度急剧下降。",
    [18130001] = "品质",
    [18130002] = "品牌",
    [18130003] = "评分",
    [18130004] = "土地",
    [18130005] = "商品合成表",
    [18130006] = "科技等级",
    [18130007] = "每个商品都有对应的科技等级，初始等级为1级。科技等级对应品质，科技等级越高品质越高。利用科技图纸可以将科技提升至对应等级。",
    [18130008] = "商品品质",
    [18130009] = "科技等级决定商品品质，商品科技等级越高商品品质越高。",
    [18130010] = "建筑品质",
    [18130011] = "零售店，公园，住宅会有建筑品质，由人才影响。",
    [18140001] = "品牌浏览量",
    [18140002] = "每个商品都会有对应的品牌浏览量，初始为0。品牌浏览量对应品牌值，浏览量越高品牌值越高。利用广告可以提升品牌浏览量。",
    [18140003] = "商品品牌",
    [18140004] = "广告浏览量决定商品品牌，广告浏览量越高商品品牌越高。",
    [18140005] = "建筑品牌",
    [18140006] = "广告浏览量决定建筑品牌，广告浏览量越高建筑品牌越高。注：只有零售店，公园，住宅有建筑品牌。",
    [18150001] = "商品品质评分",
    [18150002] = "每个商品都会有对应的品质评分，品质评分标准是以全城所有该商品的品质进行对比，得出品质评分。NPC购买商品时会根据范围内品质评分高低进行商品选择。",
    [18150003] = "商品品牌评分",
    [18150004] = "每个商品都会有对应的品牌评分，品牌评分标准是以全城所有该商品的品牌进行对比，得出品牌评分。NPC购买商品时会根据范围内品牌评分高低进行商品选择。",
    [18150005] = "建筑评分",
    [18150006] = "零售店，公园，住宅会有建筑评分。建筑评分是由价格，距离，建筑品质，建筑品牌对比全城所有同类型建筑得出评分。NPC会根据范围内评分高低进行建筑选择。",
    [18160001] = "土地拍卖",
    [18160002] = "土地的获取方式为竞拍，Scry City中每天会定时拍卖，以出价高者获得土地。Scry City中土地每天会以固定时间竞拍，玩家在出价后当出现更高的出价时，系统会以邮件通知玩家。当前土地持续竞价时，不会影响下一个土地的拍卖。",
    [18160003] = "土地交易",
    [18160004] = "玩家可以设定土地出售价格进行土地出售，当其他玩家购买后则土地所有权转移。",
    [18160005] = "土地租赁",
    [18160006] = "玩家可以设定土地租赁的价格进行土地租赁，当其他玩家购买后，土地使用权转移。若租赁土地玩家未能支付租金，则无条件收回土地回归土地所有者。",
    [18170001] = "商品合成表",
    [18170002] = "原料生产速度",
    [18170003] = "原料由原料厂产出，可以合成商品。",
    [18170004] = "商品生产速度",
    [18170005] = "原料合成商品，商品由加工厂产出，零售店可以将商品出售给城市居民（NPC）。",
    [18170006] = "运输",
    [18170007] = "拥有仓库的建筑可以进行运输，运输会有运费产生。运费以运输距离决定。",
